import React from 'react';
import { defineCustomElements } from '@boschrexroth/nextgen-web-ui-toolkit-react';

defineCustomElements();

const App = () => (
  <div>
    <center>
    <p>DC UI BUTTON GROUP</p>
    <dc-ui-btn-group direction="column" gutter-size="32" align="center" justify="center">
      <dc-ui-button>Button 1</dc-ui-button>
      <dc-ui-button>Button 2</dc-ui-button>
      <dc-ui-button>Button 3</dc-ui-button>
    </dc-ui-btn-group><br></br>
    <p>DC UI ICONS</p>
    <dc-ui-icon name="dc_3D" color="black" size="large" aria="{'aria-label': 'dc_3D icon'}"></dc-ui-icon><br></br>
    <p>DC UI TEXT WITH BUTTON</p>
    <dc-ui-content-wrapper width="basic" background-color="grey01">
      <dc-ui-text>Hello World</dc-ui-text>
      <dc-ui-button>Button demo</dc-ui-button>
    </dc-ui-content-wrapper><br></br>
    <p>DC UI DIVIDER FOR BUTTON</p>
    <dc-ui-button>Button 1</dc-ui-button>
      <dc-ui-divider width="4" direction="horizontal"></dc-ui-divider>
    <dc-ui-button>Button 2</dc-ui-button><br></br>
    <p>DC UI GRID ITEMS</p>
    <dc-ui-grid direction="row" >
        <dc-ui-grid-item size="4">A</dc-ui-grid-item>
        <dc-ui-grid-item size="4">B</dc-ui-grid-item>
        <dc-ui-grid-item size="4">C</dc-ui-grid-item>
      </dc-ui-grid><br></br>
      <p>DC UI SPACER BETWEEN BUTTONS</p>
      <dc-ui-button>Button 1</dc-ui-button>
      <dc-ui-spacer
        direction="horizontal"
        size="64">
      </dc-ui-spacer>
      <dc-ui-button>Button 2</dc-ui-button><br></br>
      <p>The accordion component is used to display content in a collapsible way</p>
      <dc-ui-accordion heading="p" title="Accordion heading p">
        <dc-ui-text>Hello</dc-ui-text></dc-ui-accordion>
      <dc-ui-accordion heading="h1" title="Accordion heading H1">
        <dc-ui-text>Hello</dc-ui-text></dc-ui-accordion>
      <dc-ui-accordion heading="H2" title="Accordion heading H2">
        <dc-ui-text>Hello</dc-ui-text></dc-ui-accordion>
      <dc-ui-accordion heading="H3" title="Accordion heading H3">
        <dc-ui-text>Hello</dc-ui-text></dc-ui-accordion>
      <dc-ui-accordion heading="H4" title="Accordion heading H4" disabled="false">
        <dc-ui-text>Hello</dc-ui-text></dc-ui-accordion>
      <dc-ui-accordion heading="H5" title="Accordion heading H5">
        <dc-ui-text>Hello</dc-ui-text></dc-ui-accordion>
      <dc-ui-accordion heading="H6" title="Accordion heading H6">
        <dc-ui-text>Hello</dc-ui-text></dc-ui-accordion>
    </center>

  </div>
);

export default App;
